import React from 'react';

const ProjectCard = ({ project }) => (
    <div>
        <h2>{project.title}</h2>
        <p>{project.description}</p>
        <a href={project.url} target="_blank" rel="noopener noreferrer">
            Visit Project
        </a>
    </div>
);

export default ProjectCard;
